import "./product.css"
 const product = ({img,link}) => {
  return (
    <div className = "p">
     <div className ="p-browser">
        <div className="p-circle"></div>
        <div className="p-circle"></div>
        <div className="p-circle"></div>

     </div>
     <a href={link} target="_blank" rel ="noreferrer"></a>
     <img src = {img} alt="" className="p-img"></img>
    </div>
  )
}


export default product ;
